import React from "react";
import InfiniteScroll from "react-infinite-scroll-component";
import {Gallery} from "react-photoswipe-gallery";
import 'photoswipe/dist/photoswipe.css'
import 'photoswipe/dist/default-skin/default-skin.css'
import {useTypedSelector} from "../../types/redux.types";
import Photo from "./Photo";
import {fetchMorePhotos} from "../../reducers/photos.reducer";
import {useDispatch} from "react-redux";

const List = (): JSX.Element => {
    const dispatch = useDispatch();
    const divIdForLoadInfo = 'divIdForLoadInfo';

    const list = useTypedSelector((state) => state.photos.list);
    const allCountPhotos = useTypedSelector((state) => state.photos.allCount);

    const loadMorePhotos = () => {
        console.log('11111111')
        dispatch(fetchMorePhotos())
    }

    console.log('allCountPhotos', allCountPhotos)
    console.log('list.length', list.length)
    console.log(allCountPhotos > list.length)

    return (
        <Gallery>
            <div id={divIdForLoadInfo} className="photos-container">
                <InfiniteScroll
                    dataLength={list.length}
                    next={() => loadMorePhotos}
                    hasMore={allCountPhotos > list.length}
                    loader={<div/>}
                    scrollableTarget={divIdForLoadInfo}
                >
                    {list.map(photo => <Photo key={photo.id} data={photo}/>)}
                </InfiniteScroll>
            </div>
        </Gallery>
    )
}

export default List;
